import React from 'react';
import { Link } from 'react-router-dom';
import { useLanguage } from '../contexts/LanguageContext';
import { 
  MessageCircle, 
  FileText, 
  Users, 
  Shield, 
  Workflow,
  HelpCircle,
  Clock,
  Phone,
  Mail,
  MapPin
} from 'lucide-react';

const HomePage = () => {
  const { language } = useLanguage();

  const features = [
    {
      title: { en: 'AI Chat Assistant', es: 'Asistente de Chat IA' },
      description: { 
        en: 'Get instant answers to your legal questions', 
        es: 'Obtén respuestas instantáneas a tus preguntas legales' 
      },
      icon: MessageCircle,
      path: '/chat',
      color: 'bg-blue-500'
    },
    {
      title: { en: 'Forms & Documents', es: 'Formularios y Documentos' },
      description: { 
        en: 'Find and download required court forms', 
        es: 'Encuentra y descarga formularios judiciales requeridos' 
      },
      icon: FileText,
      path: '/forms',
      color: 'bg-green-500'
    },
    {
      title: { en: 'Court Staff Directory', es: 'Directorio del Personal' },
      description: { 
        en: 'Contact information for court staff', 
        es: 'Información de contacto del personal judicial' 
      },
      icon: Users,
      path: '/staff',
      color: 'bg-purple-500'
    },
    {
      title: { en: 'Domestic Violence Helper', es: 'Ayuda para Violencia Doméstica' },
      description: { 
        en: 'Specialized assistance for DV cases', 
        es: 'Asistencia especializada para casos de violencia doméstica' 
      },
      icon: Shield,
      path: '/dv-helper',
      color: 'bg-red-500'
    },
    {
      title: { en: 'Legal Process Flowchart', es: 'Diagrama del Proceso Legal' },
      description: { 
        en: 'Step-by-step guidance through legal processes', 
        es: 'Guía paso a paso a través de procesos legales' 
      },
      icon: Workflow,
      path: '/flowchart',
      color: 'bg-orange-500'
    }
  ];

  const emergencyInfo = {
    title: { en: 'Emergency Resources', es: 'Recursos de Emergencia' },
    items: [
      {
        name: { en: 'Domestic Violence Hotline', es: 'Línea de Violencia Doméstica' },
        number: '1-800-799-7233',
        description: { en: '24/7 confidential support', es: 'Apoyo confidencial 24/7' }
      },
      {
        name: { en: 'Emergency Services', es: 'Servicios de Emergencia' },
        number: '911',
        description: { en: 'For immediate danger', es: 'Para peligro inmediato' }
      },
      {
        name: { en: 'Court Self-Help Center', es: 'Centro de Autoayuda' },
        number: '650-261-5060',
        description: { en: 'Free legal assistance', es: 'Asistencia legal gratuita' }
      }
    ]
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Hero Section */}
      <div className="bg-gradient-to-r from-blue-600 to-blue-800 text-white">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-16">
          <div className="text-center">
            <h1 className="text-4xl md:text-6xl font-bold mb-6">
              {language === 'en' 
                ? 'Superior Court of California' 
                : 'Tribunal Superior de California'
              }
            </h1>
            <h2 className="text-2xl md:text-4xl font-semibold mb-8">
              {language === 'en' 
                ? 'County of San Mateo' 
                : 'Condado de San Mateo'
              }
            </h2>
            <p className="text-xl md:text-2xl mb-8 opacity-90">
              {language === 'en' 
                ? 'Self-Help Center & Legal Information Kiosk' 
                : 'Centro de Autoayuda y Quiosco de Información Legal'
              }
            </p>
            <div className="flex flex-col sm:flex-row gap-4 justify-center">
              <Link
                to="/chat"
                className="bg-white text-blue-600 px-8 py-3 rounded-lg font-semibold hover:bg-gray-100 transition-colors"
              >
                {language === 'en' ? 'Get Started' : 'Comenzar'}
              </Link>
              <Link
                to="/forms"
                className="border-2 border-white text-white px-8 py-3 rounded-lg font-semibold hover:bg-white hover:text-blue-600 transition-colors"
              >
                {language === 'en' ? 'Find Forms' : 'Encontrar Formularios'}
              </Link>
            </div>
          </div>
        </div>
      </div>

      {/* Features Grid */}
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-16">
        <h2 className="text-3xl font-bold text-center mb-12 text-gray-900">
          {language === 'en' ? 'Available Services' : 'Servicios Disponibles'}
        </h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {features.map((feature, index) => {
            const Icon = feature.icon;
            return (
              <Link
                key={index}
                to={feature.path}
                className="bg-white rounded-lg shadow-md hover:shadow-lg transition-shadow p-6 group"
              >
                <div className={`w-12 h-12 ${feature.color} rounded-lg flex items-center justify-center mb-4 group-hover:scale-110 transition-transform`}>
                  <Icon className="w-6 h-6 text-white" />
                </div>
                <h3 className="text-xl font-semibold mb-2 text-gray-900">
                  {feature.title[language]}
                </h3>
                <p className="text-gray-600">
                  {feature.description[language]}
                </p>
              </Link>
            );
          })}
        </div>
      </div>

      {/* Emergency Resources */}
      <div className="bg-red-50 border-t border-red-200">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-16">
          <div className="text-center mb-12">
            <h2 className="text-3xl font-bold text-red-900 mb-4">
              {emergencyInfo.title[language]}
            </h2>
            <p className="text-red-700 text-lg">
              {language === 'en' 
                ? 'If you are in immediate danger, call 911' 
                : 'Si estás en peligro inmediato, llama al 911'
              }
            </p>
          </div>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            {emergencyInfo.items.map((item, index) => (
              <div key={index} className="bg-white rounded-lg p-6 shadow-md">
                <div className="flex items-center mb-4">
                  <Phone className="w-5 h-5 text-red-600 mr-2" />
                  <h3 className="font-semibold text-gray-900">
                    {item.name[language]}
                  </h3>
                </div>
                <p className="text-2xl font-bold text-red-600 mb-2">
                  {item.number}
                </p>
                <p className="text-gray-600 text-sm">
                  {item.description[language]}
                </p>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Court Information */}
      <div className="bg-white">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-16">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-12">
            <div>
              <h2 className="text-3xl font-bold mb-6 text-gray-900">
                {language === 'en' ? 'Court Information' : 'Información del Tribunal'}
              </h2>
              <div className="space-y-4">
                <div className="flex items-center">
                  <MapPin className="w-5 h-5 text-gray-600 mr-3" />
                  <div>
                    <p className="font-semibold text-gray-900">
                      {language === 'en' ? 'Main Courthouse' : 'Tribunal Principal'}
                    </p>
                    <p className="text-gray-600">
                      400 County Center, Redwood City, CA 94063
                    </p>
                  </div>
                </div>
                <div className="flex items-center">
                  <Clock className="w-5 h-5 text-gray-600 mr-3" />
                  <div>
                    <p className="font-semibold text-gray-900">
                      {language === 'en' ? 'Hours' : 'Horarios'}
                    </p>
                    <p className="text-gray-600">
                      {language === 'en' ? 'Monday - Friday, 8:00 AM - 4:00 PM' : 'Lunes - Viernes, 8:00 AM - 4:00 PM'}
                    </p>
                  </div>
                </div>
                <div className="flex items-center">
                  <Phone className="w-5 h-5 text-gray-600 mr-3" />
                  <div>
                    <p className="font-semibold text-gray-900">
                      {language === 'en' ? 'Phone' : 'Teléfono'}
                    </p>
                    <p className="text-gray-600">650-261-5060</p>
                  </div>
                </div>
              </div>
            </div>
            <div>
              <h2 className="text-3xl font-bold mb-6 text-gray-900">
                {language === 'en' ? 'Need Help?' : '¿Necesitas Ayuda?'}
              </h2>
              <div className="space-y-4">
                <p className="text-gray-600">
                  {language === 'en' 
                    ? 'Our self-help center provides free assistance with court forms and procedures. Visit us in person or use our online services.'
                    : 'Nuestro centro de autoayuda proporciona asistencia gratuita con formularios y procedimientos judiciales. Visítanos en persona o usa nuestros servicios en línea.'
                  }
                </p>
                <div className="flex space-x-4">
                  <Link
                    to="/chat"
                    className="bg-blue-600 text-white px-6 py-3 rounded-lg font-semibold hover:bg-blue-700 transition-colors"
                  >
                    {language === 'en' ? 'Start Chat' : 'Iniciar Chat'}
                  </Link>
                  <Link
                    to="/staff"
                    className="border border-blue-600 text-blue-600 px-6 py-3 rounded-lg font-semibold hover:bg-blue-50 transition-colors"
                  >
                    {language === 'en' ? 'Contact Staff' : 'Contactar Personal'}
                  </Link>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
